(548, 'edd_sl_9b4b9278ab03eed62e9ded0113d4678e', 'a:2:{s:7:\"timeout\";i:1643825087;s:5:\"value\";s:53556:\"{\"new_version\":\"2.1.1\",\"stable_version\":\"2.1.1\",\"name\":\"GP Premium\",\"slug\":\"gp-premium\",\"url\":\"https:\\/\\/generatepress.com\\/downloads\\/gp-premium\\/?changelog=1\",\"last_updated\":\"2021-12-02 18:36:48\",\"homepage\":\"https:\\/\\/generatepress.com\\/downloads\\/gp-premium\\/\",\"package\":\"\",\"download_link\":\"\",\"sections\":{\"description\":\"<p>The entire collection of GeneratePress premium modules. Once activated, each module extends certain aspects of GeneratePress, giving you more options to build your website.<\\/p>\\n<h4> Documentation <\\/h4>\\n<p>Check out our <a href=\\\"https:\\/\\/docs.generatepress.com\\\">documentation<\\/a> for more information on each module and how to use them.<\\/p>\",\"changelog\":\"<h4> 2.1.1 <\\/h4>\\n<ul>\\n<li>Menu Plus: Fix mobile header sticky auto hide<\\/li>\\n<li>Site Library: Fix broken CSS variables on import<\\/li>\\n<\\/ul>\\n<h4> 2.1.0 <\\/h4>\\n<ul>\\n<li>Blog: Fix masonry JS error if no archive pagination exists<\\/li>\\n<li>Blog: Fix full width featured blog column<\\/li>\\n<li>Colors: Deprecate module if using GP 3.1.0<\\/li>\\n<li>Elements: Add custom class option to dynamic image block<\\/li>\\n<li>Elements: Add support for post_type array in display rules<\\/li>\\n<li>Elements: Fix container link option when targeting next\\/previous posts<\\/li>\\n<li>Menu Plus: Integrate off-canvas panel with new dynamic typography system<\\/li>\\n<li>Menu Plus: Integrate off-canvas panel with new color system<\\/li>\\n<li>Menu Plus: Integrate mobile header HTML attributes with new HTML attribute system<\\/li>\\n<li>Menu Plus: Integrate mobile header and off-canvas panel with new generate_has_active_menu filter<\\/li>\\n<li>Menu Plus: Fix broken inline CSS when using floated sticky navigation<\\/li>\\n<li>Menu Plus: Add logo dimensions to navigation logo<\\/li>\\n<li>Secondary Navigation: Integrate with new color system<\\/li>\\n<li>Secondary Navigation: Integrate with new generate_has_active_menu filter<\\/li>\\n<li>Secondary Navigation: Integrate with new dynamic typography system<\\/li>\\n<li>Secondary Navigation: Reduce box-shadow to match main navigation<\\/li>\\n<li>Secondary Navigation: Change direction of sub-menu box-shadow when opening left<\\/li>\\n<li>Secondary Navigation: Fix sub-menu overlap when using dropdown click\\/mobile<\\/li>\\n<li>Secondary Navigation: Replace box-shadow with border-bottom when sub-menu opens down<\\/li>\\n<li>Site Library: Add site author attribution<\\/li>\\n<li>Typography: Deprecate module if using dynamic typography in GP 3.1.0<\\/li>\\n<li>WooCommerce: Integrate with new dynamic typography system<\\/li>\\n<li>WooCommerce: Integrate with new colors system<\\/li>\\n<li>WooCommerce: Remove category title\\/description if using page hero with title disabled<\\/li>\\n<li>WooCommerce: Remove &quot;speak&quot; CSS properties<\\/li>\\n<li>WooCommerce: Fix empty continue shopping link on mobile<\\/li>\\n<li>WooCommerce: Fix persistent sticky add to cart panel<\\/li>\\n<li>General: Integrate with new GP 3.1.0 Dashboard<\\/li>\\n<li>General: Remove featured-image-active body class if featured image is disabled<\\/li>\\n<li>General: Change date format in exported JSON filename<\\/li>\\n<li>General: Fix PHP error when license key activation returns 403<\\/li>\\n<\\/ul>\\n<h4> 2.0.3 <\\/h4>\\n<ul>\\n<li>Elements: Use block_categories_all filter in WP 5.8<\\/li>\\n<li>Elements: Remove wp-editor dependency from new widget editor<\\/li>\\n<\\/ul>\\n<h4> 2.0.2 <\\/h4>\\n<ul>\\n<li>Elements: Use blog page title for dynamic title if set<\\/li>\\n<li>Spacing: Fix reset button bug in Customizer controls<\\/li>\\n<li>WooCommerce: Fix infinite scroll applying to product taxonomy pages<\\/li>\\n<\\/ul>\\n<h4> 2.0.1 <\\/h4>\\n<ul>\\n<li>Blog: Fix infinite scroll bug on product archives<\\/li>\\n<li>Elements: Fix error in WP 4.9.x versions<\\/li>\\n<li>Menu Plus: Prevent 0x0 logo dimension attributes if no dimensions exist<\\/li>\\n<li>Site Library: Add vertical scroll ability to the Site Library control area<\\/li>\\n<\\/ul>\\n<h4> 2.0.0 <\\/h4>\\n<ul>\\n<li>Blog: Rewrite infinite scroll using vanilla javascript<\\/li>\\n<li>Blog: Rewrite masonry using vanilla javascript<\\/li>\\n<li>Blog: Add separate infinite scroll path element to footer<\\/li>\\n<li>Blog: Fix missing single\\/page featured image options when archive image disabled<\\/li>\\n<li>Blog: Add aria-label instead of screen-reader-text to read more button<\\/li>\\n<li>Colors: Fix back to top Customizer color preview<\\/li>\\n<li>Elements: New Content Template Element<\\/li>\\n<li>Elements: New Post Meta Template Element<\\/li>\\n<li>Elements: New Post Navigation Template Element<\\/li>\\n<li>Elements: New Page Hero Block Element<\\/li>\\n<li>Elements: New Archive Navigation Template Element<\\/li>\\n<li>Elements: New Editor Width option in Block Elements<\\/li>\\n<li>Elements: Move Block Elements options into editor sidebar<\\/li>\\n<li>Elements: Show Site Header options by default in Header Element<\\/li>\\n<li>Elements: Fix Classic Editor issue in Block Elements<\\/li>\\n<li>Elements: Add a list of active Elements to page editor<\\/li>\\n<li>Elements: Add a list of active Elements to the admin bar<\\/li>\\n<li>Elements: Add notices to Customizer if Elements may be overwriting options<\\/li>\\n<li>Elements: Disable mobile header menu if menu is disabled via Layout Element<\\/li>\\n<li>Elements: Improve Display Rule loading performance<\\/li>\\n<li>Elements: Add block type filter to Elements dashboard<\\/li>\\n<li>Elements: Add generate_element_display filter<\\/li>\\n<li>Elements: Add No Results as a Display Rule condition<\\/li>\\n<li>Menu Plus: Hide slideout toggle at set mobile menu breakpoint value<\\/li>\\n<li>Menu Plus: Fix sticky menu height when using navigation as header<\\/li>\\n<li>Menu Plus: Add dimensions to mobile\\/sticky logos<\\/li>\\n<li>Menu Plus: Make Off-Canvas menu take up full width of canvas<\\/li>\\n<li>Menu Plus: Fix menu bar item sticky transition<\\/li>\\n<li>Menu Plus: Prevent sticky sidebar nav if mobile header is set to sticky<\\/li>\\n<li>Secondary Nav: Fix centered secondary navigation items using flexbox<\\/li>\\n<li>Secondary Nav: Fix conflict with Nav as Header option<\\/li>\\n<li>Secondary Nav: Fix missing menu cart items when using click dropdowns<\\/li>\\n<li>Sections: Officially deprecate module<\\/li>\\n<li>Site Library: Completely rebuild Site Library using React<\\/li>\\n<li>WooCommerce: Move full width single product CSS to inline CSS<\\/li>\\n<li>WooCommerce: Use wc_get_product() instead of new WC_Product()<\\/li>\\n<li>WooCommerce: Add more checks for WC() class to prevent error logs<\\/li>\\n<li>WooCommerce: Add generate_wc_cart_panel_checkout_button_output filter<\\/li>\\n<li>WooCommerce: Add generate_wc_sticky_add_to_cart_action filter<\\/li>\\n<li>WooCommerce: Add generate_wc_show_sticky_add_to_cart filter<\\/li>\\n<li>WooCommerce: Re-write quantity button javascript to be more performant\\/extendable<\\/li>\\n<li>General: Update theme install link<\\/li>\\n<li>General: Update alpha color picker script<\\/li>\\n<li>General: Use correct URL scheme in external stylesheet URLs<\\/li>\\n<li>General: Check if FS_CHMOD_FILE is defined in external stylesheet generation<\\/li>\\n<li>General: Use inline CSS when using AMP plugin<\\/li>\\n<li>General: Update EDD_SL_Plugin_Updater class to 1.8.0<\\/li>\\n<li>General: Clean up javascript throughout plugin<\\/li>\\n<li>General: Replace deprecated jQuery functions<\\/li>\\n<\\/ul>\\n<h4> 1.12.3 <\\/h4>\\n<ul>\\n<li>WooCommerce: Fix quantity buttons in WP 5.6<\\/li>\\n<\\/ul>\\n<h4> 1.12.2 <\\/h4>\\n<ul>\\n<li>Blog: Load columns CSS when using filter to enable it anywhere<\\/li>\\n<li>Menu Plus: Fix sticky mobile header jump when using inline mobile toggle<\\/li>\\n<li>Menu Plus: Add margin to sticky nav branding when set to full width<\\/li>\\n<li>Menu Plus: Disable sticky nav container text align padding<\\/li>\\n<li>Menu Plus: Make mobile menu absolute only when smooth scroll is enabled<\\/li>\\n<li>Menu Plus: Improve nav as header\\/mobile header when using flexbox<\\/li>\\n<li>Menu Plus: Prevent off-canvas panel close button from flashing visible when closing<\\/li>\\n<li>Spacing: Fix custom nav search height<\\/li>\\n<\\/ul>\\n<h4> 1.12.1 <\\/h4>\\n<ul>\\n<li>Typography: Fix missing heading font size controls in the Customizer<\\/li>\\n<\\/ul>\\n<h4> 1.12.0 <\\/h4>\\n<ul>\\n<li>Blog: Fix column margin on mobile with some caching plugins<\\/li>\\n<li>Blog: Add post-load trigger to infinite scroll for better plugin compatibility<\\/li>\\n<li>Blog: Take generate_blog_columns filter into account when loading columns CSS<\\/li>\\n<li>Colors: Add search menu-bar-item color live preview to Customizer<\\/li>\\n<li>Elements: Fix broken custom hook field in Block Elements<\\/li>\\n<li>Elements: Integrate page hero with text container alignment in GP 3.0<\\/li>\\n<li>Elements: Better integrate Header Element colors with GP 3.0<\\/li>\\n<li>Elements: Only disable content title when {{post_title}} is present on single pages<\\/li>\\n<li>Elements: Fix  tag in metabox<\\/li>\\n<li>Elements: Add generate_elements_metabox_ajax_allow_editors filter<\\/li>\\n<li>Elements: Add new 3.0 hooks to hook selector<\\/li>\\n<li>Elements: Re-add generate_elements_custom_args filter<\\/li>\\n<li>Menu Plus: Better prepare navigation as header for GP 3.0<\\/li>\\n<li>Menu Plus: Better prepare Off-Canvas Panel for GP 3.0<\\/li>\\n<li>Menu Plus: Better prepare sticky navigation for GP 3.0<\\/li>\\n<li>Menu Plus: Add has-menu-bar-items class to mobile header if needed<\\/li>\\n<li>Menu Plus: Add is-logo-image class to all site logos<\\/li>\\n<li>Menu Plus: Fix mobile header alignment when it has menu bar items<\\/li>\\n<li>Secondary Nav: Better prepare sticky navigation for GP 3.0<\\/li>\\n<li>Secondary Nav: Fix hidden navigation widget in top bar when merged with secondary nav<\\/li>\\n<li>Sites: Improve the option-only import feature<\\/li>\\n<li>Sites: Improve the refresh sites button functionality<\\/li>\\n<li>Sites: Improve the undo site import functionality<\\/li>\\n<li>Sites: Fix Elementor site import issues<\\/li>\\n<li>Sites: Re-add Elementor sites to library<\\/li>\\n<li>Spacing: Better prepare Customizer live preview for GP 3.0<\\/li>\\n<li>Spacing: Fix blog column spacing Customizer live preview<\\/li>\\n<li>Spacing: Stop handling mobile header, widget and footer widget features added in GP 3.0<\\/li>\\n<li>Typography: Add mobile font size control for H3 (when using GP 3.0)<\\/li>\\n<li>Typography: Add mobile font size control for H4 (when using GP 3.0)<\\/li>\\n<li>Typography: Add mobile font size control for H5 (when using GP 3.0)<\\/li>\\n<li>Typography: Allow empty tablet and mobile site title font size values<\\/li>\\n<li>Typography: Make menu toggle CSS selector specific to primary navigation<\\/li>\\n<li>WooCommerce: Use CSS for secondary product image functionality instead of JS<\\/li>\\n<li>WooCommerce: Only load .js file if needed<\\/li>\\n<li>WooCommerce: Fix quantity box functionality when multiple quantity boxes exist on the page<\\/li>\\n<li>General: Improve alpha color picker script for better 5.5 compatibility<\\/li>\\n<li>General: Move child theme stylesheet after dynamic stylesheet if enabled<\\/li>\\n<li>General: Update gp-premium-de_DE.mo<\\/li>\\n<li>General: Update gp-premium-es_ES.mo<\\/li>\\n<li>General: Update gp-premium-fi.mo<\\/li>\\n<li>General: Update gp-premium-pt_PT.mo<\\/li>\\n<li>General: Update gp-premium-sv_SE.mo<\\/li>\\n<\\/ul>\\n<h4> 1.11.3 <\\/h4>\\n<ul>\\n<li>Blog: Set widths to grid-sizer element<\\/li>\\n<li>Elements: Fix legacy Page Header\\/Hooks buttons in the Elements dashboard<\\/li>\\n<li>Page Header: Replace .load() with .on(\'load\')<\\/li>\\n<li>Page Header: Fix color picker error in WP 5.5<\\/li>\\n<\\/ul>\\n<h4> 1.11.2 <\\/h4>\\n<ul>\\n<li>Blog: Remove negative featured image top margin from columns when using one container<\\/li>\\n<li>Blog: Fix infinite scroll items loading above viewport when using columns<\\/li>\\n<li>Blog: Fix infinite scroll featured images not displaying in Safari<\\/li>\\n<li>Elements: Prevent error in editor when generate_get_option() function doesn\'t exist<\\/li>\\n<li>General: Load inline CSS in previews when using external CSS option<\\/li>\\n<li>General: Update gp-premium-es_ES.mo<\\/li>\\n<li>General: Update gp-premium-pt_PT.mo<\\/li>\\n<\\/ul>\\n<h4> 1.11.1 <\\/h4>\\n<ul>\\n<li>Elements: Remove stray quote character in Layout Element metabox<\\/li>\\n<li>Sections: Fix color picker JS error in WP 5.5<\\/li>\\n<li>General: Fix external CSS option not removing inline CSS in some cases<\\/li>\\n<\\/ul>\\n<h4> 1.11.0 <\\/h4>\\n<ul>\\n<li>New: Block Elements<\\/li>\\n<li>New: Apply Layout Element options to the block editor if set<\\/li>\\n<li>New: Generate dynamic CSS in an external file<\\/li>\\n<li>Blog: Separate CSS and load only when needed<\\/li>\\n<li>Blog: Add column width classes to stylesheet<\\/li>\\n<li>Blog: Disable featured image itemprop if microdata is disabled<\\/li>\\n<li>Blog: Add generate_blog_masonry_init filter<\\/li>\\n<li>Blog: Add generate_blog_infinite_scroll_init filter<\\/li>\\n<li>Blog: Fix archive page header overlap when using no featured image padding\\/one container<\\/li>\\n<li>Blog: Replace screen reader text with aria-label in read more buttons<\\/li>\\n<li>Disable Elements: Add option to disable the Mobile Header<\\/li>\\n<li>Disable Elements: Disable top bar disables it even when combined with Secondary Nav<\\/li>\\n<li>Disable Elements: Use generate_show_post_navigation filter to disable single post navigation<\\/li>\\n<li>Elements: Use full hook name with generate_ prefix in dropdown<\\/li>\\n<li>Elements: Rebuild how Element types are chosen<\\/li>\\n<li>Elements: Add chosen hook under typ