how number of items in cart menu item<\\/li>\\n<li>WooCommerce: Add option to choose single product image area width<\\/li>\\n<li>WooCommerce: Add color options for price slider widget<\\/li>\\n<li>WooCommerce: Use CSS grid for the product archives<\\/li>\\n<li>WooCommerce: Horizontally align add to cart buttons<\\/li>\\n<li>WooCommerce: Re-design the cart widget<\\/li>\\n<li>WooCommerce: Tighten up product info spacing<\\/li>\\n<li>WooCommerce: Improve product tab design to look more like tabs<\\/li>\\n<li>WooCommerce: Simplify single product image display<\\/li>\\n<li>WooCommerce: Use flexbox for quantity\\/add to cart alignment<\\/li>\\n<li>WooCommerce: Improve rating star styles<\\/li>\\n<li>WooCommerce: Use product alignment setting for related\\/upsell products<\\/li>\\n<li>WooCommerce: Remove bottom margin from product image<\\/li>\\n<li>WooCommerce: Organize colors in the Customizer<\\/li>\\n<li>WooCommerce: Remove title attribute from menu cart item<\\/li>\\n<li>WooCommerce: Improve coupon field design<\\/li>\\n<li>WooCommerce: Improve result count\\/ordering styling<\\/li>\\n<li>WooCommerce: Add gap around WC single product images<\\/li>\\n<li>WooCommerce: Remove arrow from checkout button<\\/li>\\n<li>WooCommerce: Hide view cart link on add to cart click<\\/li>\\n<li>WooCommerce: Organize CSS<\\/li>\\n<li>Introduce in-Customizer shortcuts<\\/li>\\n<li>Add generate_disable_customizer_shortcuts filter<\\/li>\\n<\\/ul>\"],\"plugin\":\"gp-premium\\/gp-premium.php\",\"id\":\"gp-premium\\/gp-premium.php\"}\";}', 'no');
